import React, {useState, useEffect} from 'react'
import Board from '../components/board/Board'
import axios from 'axios'

function Home() {
    const [boards, setBoards] = useState([])

    useEffect(() => {
        const fetchBoards = async () => {
            const boards = await axios.get('/boards')
            setBoards(boards)
        }
        fetchBoards()
    }, [])

    return (
        <div className = 'home'>
            <Board/>
        </div>
    )
}

export default Home
